import React, { useState } from "react";
import {
  View,
  StyleSheet,
  Pressable,
  Image,
  Text,
  VirtualizedList,
} from "react-native";
import Topnav from "../components/Topnav";
import Destyevents1 from "../components/Destyevents1";
import { useNavigation } from "@react-navigation/native";
import { Color, Padding } from "../GlobalStyles";
import Search from "./search";

const Feed = () => {
  const [flatListFlatListData, setFlatListFlatListData] = useState([
    { key: "1", component: <Destyevents1 /> },  
    { key: "1", component: <Destyevents1 /> },  
    { key: "1", component: <Destyevents1 /> },
    { key: "1", component: <Destyevents1 /> },  
    { key: "1", component: <Destyevents1 /> },  
  ]);
  const navigation = useNavigation();
  const getItemCount = (data) => data.length;
  const getItem = (data, index) => data[index];
  const renderVirtualizedItem = ({ item }) => item.component;
  return (
    <View style={[styles.feed, styles.feedFlexBox]}>
      <Topnav />
      <VirtualizedList
        data={flatListFlatListData}
        renderItem={renderVirtualizedItem}
        keyExtractor={(item) => item.key}
        getItemCount={getItemCount}
        getItem={getItem}
        contentContainerStyle={styles.flatListFlatListContent}
        ListHeaderComponent={<Search />}
      />
      <View style={[styles.bottomview, styles.headerPosition]} />
      <Pressable style={styles.createbtn} onPress={() => navigation.navigate("CreatePost")}>
        <Image
          style={styles.vectorIcon1}
          resizeMode="cover"
          source={require("../assets/Create.png")}
        />
      </Pressable>
    </View>
  );
};

const styles = StyleSheet.create({
  flatListFlatListContent: {
    flexDirection: "column",
    marginTop: 66,
  },
  feedFlexBox: {
    flex: 1,
    overflow: "hidden",
  },
  headerPosition: {
    left: 0,
    position: "absolute",
  },
  vectorIconLayout: {
    height: 20,
    width: 20,
  },
  flatList: {
    marginTop: 3,
    overflow: "hidden",
  },
  scrollview: {
    top: 101,
    height: 688,
    alignItems: "center",
  },
  bottomview: {
    top: 788,
  },
  vectorIcon1: {
    bottom: 80, right: 20,
    width: 50,
    height: 50,
  },
  createbtn: {
    top: 718,
    left: 311,
    padding: Padding.p_3xs,
    position: "absolute",
  },
  header: {
    top: 0,
  },
  feed: {
    backgroundColor: "#f8f8f8",
    width: "100%",
    height: 852,
    overflow: "hidden",
  },
});

export default Feed;
